import React from "react";
import styled from "styled-components";

const Container = styled.div`
    width:100%;
    display:flex;
    background:#e5e5e5;
`;
const Row = styled.div`
    max-width:1000px;
    display:flex;
    padding:30px;
`;
const Left = styled.div`
    margin:15px;
    padding:
    width:50%;
    p {
        font-size: 1.5rem;
        margin-left: 15px;
      }

`;
const Right = styled.div`
    margin:15px;
    width:50%;
    p {
        font-size: 1.5rem;
        margin-left: 15px;
      }
`;

const Projects = () => {
  return (
    <>
      <Container>
        <h1>Hi</h1>
        <Row>
          <Left>Left</Left>
          <Right>Right</Right>
        </Row>
      </Container>
    </>
  );
};

export default Projects;
